import React from 'react';
import logo from './logo.svg';
import './App.css';
import Navbar from "./components/navbar"
import Counters from "./Counters";

function App() {
  return (
    <React>
      <Navbar />
      <main className="container">
        <Counters />
      </main>
    </React>
  );
}

export default App;
